import { CO } from '../doc-js.parser.options';
import { ClassKind } from '../../model';

export class Common {

  getName(obj: any): string {
    return obj[CO.name] ? obj[CO.name] : '';
  }

  getShortDescription(obj: any): string {
    let shortDescription: string = '';
    if (obj[CO.description] && obj[CO.description][CO.children].length) {
      if (obj[CO.description][CO.children][0][CO.children].length) {
        obj[CO.description][CO.children][0][CO.children]
          .forEach((item: any) => {
            shortDescription += item[CO.value] + ' ';
          });
      }
      return shortDescription;
    } else {
      return '';
    }
  }

  getDescription(obj: any): string {
    let str: string = '';
    if (obj[CO.description]) {
      if (obj[CO.description][CO.children].length > 1)
        obj[CO.description][CO.children]
          .forEach((item: any) => {
            item[CO.children]
              .forEach((item: any) => {
                str += item[CO.value] + ' ';
              });
          });
      return str;

    } else {
      return '';
    }
  }

  getKind(obj: any): ClassKind {
    return obj[CO.classKind] ? obj[CO.classKind] : 'class';
  }
}

import { Example } from '../../model';
import { CO } from '../doc-js.parser.options';

export class ExamplesParser {

  getExamples(obj: any): Example[] {
    if (obj[CO.examples].length) {
      return obj[CO.examples].map((item: any) => this.parseExample(item));
    } else {
      return [];
    }
  }

  parseExample(obj: any): Example {
    return new Example({
      code: this.getCode(obj),
      description: this.getDescription(obj),
      shortDescription: this.getShortDescription(obj)
    });
  }

  splitExample(example: any) {
    if (example[CO.description]) {
      return example[CO.description].split(/```/g);
    } else {
      return [];
    }
  }

  getCode(example: any) {
    const splittedExample = this.splitExample(example);
    if (splittedExample.length !== 0) {
      return splittedExample[1];
    } else {
      return ''
    }
  }

  getDescription(example: any) {
    const splittedExample = this.splitExample(example);
    const shortDescription = splittedExample[0].split('\r\n')[0];
    if (splittedExample.length !== 0) {
      return splittedExample[0].replace(shortDescription, '');
    } else {
      return ''
    }
  }

  getShortDescription(example: any) {
    const splittedExample = this.splitExample(example);
    if (splittedExample.length !== 0) {
      return splittedExample[0].split('\r\n')[0];
    } else {
      return ''
    }
  }
}

