import { Method } from '../../model';
import { CO } from '../doc-js.parser.options';
import { ParamsParser, ExamplesParser } from './';
import { Common } from './common';

export class MethodsParser {
  protected examples: ExamplesParser = new ExamplesParser();
  protected params: ParamsParser = new ParamsParser();
  protected common: Common = new Common();

  getMethods(obj: any): Method[] {
    return this.getMethodsInstance(obj).concat(this.getMethodsStatic(obj));
  }

  getMethodsInstance(obj: any): Method[] {
    if (this.isHasMethodsFrom(obj, 'instance')) {
      return obj[CO.members][CO.instance]
        .filter((item: any) => this.isFunction(item))
        .map((item: any) => this.parseMethodFromInstance(item));
    } else {
      return [];
    }
  }

  getMethodsStatic(obj: any): Method[] {
    if (this.isHasMethodsFrom(obj, 'static')) {
      return obj[CO.members][CO.static]
        .filter((item: any) => this.isFunction(item))
        .map((item: any) => this.parseMethodFromStatic(item));
    } else {
      return [];
    }
  }

  parseMethodFromInstance(obj: any): Method {
    return new Method({
      examples: this.examples.getExamples(obj),
      params: this.params.getParams(obj),
      platform: null,
      name: this.common.getName(obj),
      type: this.getType(obj),
      isStatic: false,
      shortDescription: this.common.getShortDescription(obj),
      description: this.common.getDescription(obj)
    });
  }

  parseMethodFromStatic(obj: any): Method {
    return new Method({
      examples: this.examples.getExamples(obj),
      params: this.params.getParams(obj),
      platform: null,
      name: this.common.getName(obj),
      type: this.getType(obj),
      isStatic: true,
      shortDescription: this.common.getShortDescription(obj),
      description: this.common.getDescription(obj)
    });
  }

  getType(obj: any) {
    let temp: any[] = [];
    if (obj[CO.methodType] && obj[CO.methodType].length) {
      obj[CO.methodType]
        .forEach((item: any) => {
          temp.push(item[CO.type][CO.name]);
        });
      return temp;
    } else {
      return ['void'];
    }
  }

  isFunction(obj: any) {
    return obj[CO.kind] === 'function';
  }

  isHasMethodsFrom(obj: any, from: string) {
    return obj[CO.members] && obj[CO.members][from].length;
  }
}

import { Param } from '../../model';
import { CO } from '../doc-js.parser.options';
import { Common } from "./common";

export class ParamsParser {

  protected common: Common = new Common();

  getParams(obj: any): Param[] {
    if (obj[CO.params] && obj[CO.params].length) {
      return obj[CO.params].map((item: any) => this.parseParam(item));
    } else {
      return [];
    }
  }

  parseParam(obj: any): Param {
    return new Param({
      name: this.common.getName(obj),
      type: this.getType(obj),
      required: null,
      shortDescription: this.common.getShortDescription(obj),
      description: this.common.getDescription(obj)
    });
  }

  getType(param: any): string {
    return param[CO.paramType] ? param[CO.paramType][CO.name] : '';
  }

}

import { Prop } from '../../model';
import { Common } from './common'
import { CO } from '../doc-js.parser.options';

export class PropertiesParser {
  protected common: Common = new Common();

  getProps(obj: any): Prop[] {
    return this.getPropsFromProperties(obj).concat(this.getPropsFromInstance(obj).concat(this.getPropsFromStatic(obj)));
  }

  getPropsFromProperties(obj: any): Prop[] {
    if (obj[CO.properties] && obj[CO.properties].length) {
      return obj[CO.properties].map((item: any) => this.parsePropFromProperties(item));
    } else {
      return [];
    }
  }

  getPropsFromInstance(obj: any): Prop[] {
    if (obj[CO.members] && obj[CO.members][CO.instance].length) {
      return obj[CO.members][CO.instance]
        .filter((item: any) => item[CO.kind] === 'member')
        .map((item: any) => this.parsePropFromInstance(item));
    } else {
      return [];
    }
  }

  getPropsFromStatic(obj: any): Prop[] {
    if (obj[CO.members] && obj[CO.members][CO.static].length) {
      return obj[CO.members][CO.static]
        .filter((item: any) => item[CO.kind] === 'member')
        .map((item: any) => this.parsePropFromStatic(item));
    } else {
      return [];
    }
  }

  parsePropFromProperties(obj: any): Prop {
      return new Prop({
        kind: 'prop',
        platform: null,
        isStatic: false,
        type: this.getTypeProperties(obj),
        required: null,
        name: this.common.getName(obj),
        shortDescription: this.isDescriptionsCoincide(obj) ? '' : this.getShortDescriptionProperties(obj),
        description: this.getDescriptionProperties(obj)
      });
  }

  parsePropFromInstance(obj: any): Prop {
    return new Prop({
      kind: 'property',
      platform: null,
      isStatic: false,
      type: this.getTypeInstance(obj),
      required: null,
      name: this.common.getName(obj),
      shortDescription: this.getShortDescriptionInstance(obj),
      description: this.getDescriptionInstance(obj)
    });
  }

  parsePropFromStatic(obj: any): Prop {
    return new Prop({
      kind: 'property',
      platform: null,
      isStatic: true,
      type: this.getTypeStatic(obj),
      required: null,
      name: this.common.getName(obj),
      shortDescription: this.getDescriptionStatic(obj),
      description: this.getDescriptionStatic(obj)
    });
  }

  getDescriptionInstance(prop: any): string {
    let str: string = '';
    if (prop[CO.description] && prop[CO.description][CO.children].length > 1) {
      prop[CO.description][CO.children]
        .forEach((item: any) => {
          item[CO.children]
            .forEach((item: any) => {
              str += item[CO.value] + ' ';
            });
        });
      return str.split('}')[1].trim();
    } else {
      return '';
    }
  }

  getDescriptionProperties(prop: any): string {
    let description: string = '';

    if (prop && prop[CO.description] && prop[CO.description][CO.children].length) {
      prop[CO.description][CO.children][0][CO.children]
        .forEach((item: any) => {
          description += item[CO.value] + ' ';
        });
      return description;
    } else {
      return '';
    }
  }

  getDescriptionStatic(prop: any): string {
    if (prop && prop[CO.tags]) {
      return prop[CO.tags][0][CO.description];
    } else {
      return '';
    }
  }

  getShortDescriptionProperties(prop: any): string {
    if (prop && prop[CO.description]) {
      return prop[CO.description][CO.children][0][CO.children][0][CO.value].trim();
    } else {
      return '';
    }
  }

  getShortDescriptionInstance(prop: any): string {
    if (prop && prop[CO.description]) {
      return prop[CO.description][CO.children][0][CO.children][0][CO.value]
        .split('}')[1].trim();
    } else {
      return '';
    }
  }

  getTypeProperties(prop: any): string {
    if (prop && prop[CO.type]) {
      return (prop[CO.type][CO.name]);
    } else {
      return '';
    }
  }

  getTypeStatic(prop: any): string {
    if (prop && prop[CO.properties]) {
      return prop[CO.properties][0][CO.type][CO.name];
    } else {
      return '';
    }
  }

  getTypeInstance(prop: any): string {
    if (prop && prop[CO.description]) {
      return prop[CO.description][CO.children][0]
        [CO.children][0][CO.value]
        .split(' ')[0].replace(/[{}]/g, '');
    } else {
      return '';
    }
  }

  isDescriptionsCoincide(obj: any): boolean {
    return this.getShortDescriptionProperties(obj).trim() === this.getDescriptionProperties(obj).trim() ||
      this.getDescriptionProperties(obj).indexOf(this.getShortDescriptionProperties(obj)) != -1;
  }
}

import { Style } from '../../model';
import { CO } from '../doc-js.parser.options';

export class StylesParser {

  getStyles(obj: any): Style[] {
    if (obj[CO.tags] && obj[CO.tags].length) {
      return obj[CO.tags]
        .filter((item: any) => this.isStyle(item))
        .map((item: any) => this.parseStyle(item));
    } else
      return [];
  }

  parseStyle(obj: any) {
    return new Style({
      shortDescription: this.getShortDescription(obj),
      styles: this.getStylesOfStyle(obj)
    });
  }

  getShortDescription(style: any): string {
    if (style[CO.description]) {
      return style[CO.description].split('\n')[0];
    } else {
      return '';
    }
  }

  getStylesOfStyle(style: any): any[] {
    if (style[CO.description]) {
      const arr = style[CO.description].split('\n');
      const arrTemp: any = [];
      arr.splice(0, 1);
      arr.forEach((item: any) => {
        const [key, value] = item.split(':');
        const styleObj: any = {};
        styleObj['name'] = key ? key.replace(/[`-]/g, '').trim() : '';
        styleObj['description'] = value ? value.trim() : '';
        arrTemp.push(styleObj);
      });
      return arrTemp;
    } else {
      return [];
    }
  }

  isStyle(obj: any) {
    return obj[CO.title] === 'styles';
  }
}

