import { Method } from '../../model';
import { CO } from '../typedoc.parser.options';
import { ExamplesParser, ParamsParser } from './';

export class MethodsParser {
  protected params: ParamsParser = new ParamsParser();
  protected examples: ExamplesParser = new ExamplesParser();

  getMethods(obj: any): Method[] {
    if (obj && obj[CO.children]) {
      return obj[CO.children]
        .filter((item: any) => this.isMethod(item) || this.isConstructor(item))
        .map((item: any) => this.parseMethod(item));
    } else {
      return [];
    }
  }

  parseMethod(obj: any): Method {
    return new Method({
      examples: [],
      params: this.params.getParams(obj),
      platform: null,
      name: obj[CO.name],
      type: this.getType(obj),
      isStatic: this.isStatic(obj),
      shortDescription: this.getShortDescription(obj),
      description: this.getDescription(obj),
    });
  }

  getDescription(obj: any): string {
    if (this.isHasDescription(obj)) {
      return obj[CO.signatures][0][CO.comment]['text'];
    } else {
      return '';
    }
  }

  getShortDescription(obj: any): string {
    if (this.isHasDescription(obj)) {
      return obj[CO.signatures][0][CO.comment]['shortText'];
    } else {
      return '';
    }
  }

  getType(obj: any): string[] {
    let returnedType = '';
    if (obj[CO.signatures] && obj[CO.signatures][0][CO.type]) {
      returnedType = this.determineType(obj[CO.signatures][0]);
    }
    return [returnedType];
  }

  determineType(obj: any) {
    if (this.isIntrinsic(obj[CO.type])) {
      return this.parseIntrinsic(obj);
    } else if (this.isReflection(obj[CO.type])) {
      return this.parseReflection(obj);
    } else if (this.isReference(obj[CO.type])) {
      return this.parseReference(obj);
    } else if (this.isArray(obj[CO.type])) {
      return this.parseArray(obj);
    } else if (this.isTypeParameter(obj[CO.type])) {
      return this.parseTypeParameter(obj);
    }
  }

  parseIntrinsic(obj: any) {
    return obj[CO.type][CO.name];
  }

  parseReference(obj: any) {
    let returnedType = '';
    if (obj[CO.comment] && obj[CO.comment][CO.returns]) {
      const checkString = obj[CO.comment][CO.returns].replace(/[{}<>]+/g, '');
      if (checkString.length > 1) {
        returnedType = obj[CO.comment][CO.returns];
      } else {
        returnedType = this.parseReferenceFromTypeArguments(obj);
      }
      return returnedType;
    } else {
      return this.parseReferenceFromTypeArguments(obj);
    }
  }

  parseReferenceFromTypeArguments(obj: any) {
    const mainTypeName = obj[CO.type][CO.name];
    let helperType = '';
    if (obj[CO.type] && obj[CO.type][CO.typeArguments] && obj[CO.type][CO.typeArguments].length !== 0) {
      if (obj[CO.type][CO.typeArguments][0][CO.declaration] &&
        obj[CO.type][CO.typeArguments][0][CO.declaration][CO.children].length !== 0) {
        return mainTypeName + this.parseReferenceFromTypeArgumentsChildren(obj);
      } else if (obj[CO.type][CO.typeArguments][0][CO.elementType]) {
        return mainTypeName + this.parseReferenceFromTypeArgumentsElementType(obj);
      } else {
        return mainTypeName + '<' + obj[CO.type][CO.typeArguments][0][CO.name] + '>';
      }
    } else {
      return obj[CO.type][CO.name];
    }
  }

  parseReferenceFromTypeArgumentsChildren(obj: any) {
    let helperType = '';
    let helperItemsArray: any[] = [];
    obj[CO.type][CO.typeArguments][0][CO.declaration][CO.children].forEach((item: any) => {
      helperType = this.determineType(item);
      helperItemsArray.push(item[CO.name] + ': ' + helperType)
    });
    return '<{' + helperItemsArray.toString().replace(',', '; ') + '}>';
  }

  parseReferenceFromTypeArgumentsElementType(obj: any) {
    let helperType = '';
    // todo find another kind of such preparation
    obj[CO.type][CO.typeArguments][0].type = {
      type: obj[CO.type][CO.typeArguments][0][CO.type],
      elementType: obj[CO.type][CO.typeArguments][0][CO.elementType],
    };
    helperType = this.determineType(obj[CO.type][CO.typeArguments][0]);
    return '<' + helperType + '>';
  }

  parseReflection(obj: any) {
    if (obj[CO.type][CO.declaration][CO.children] && obj[CO.type][CO.declaration][CO.children].length !== 0) {
      return this.parseTypeFromReflectionChildren(obj);
    } else if (obj[CO.type][CO.declaration][CO.indexSignature] &&
      obj[CO.type][CO.declaration][CO.indexSignature].length !== 0) {
      return this.parseTypeFromReflectionIndexSignature(obj);
    } else {
      return this.parseTypeFromSignature(obj);
    }
  }

  parseTypeFromReflectionChildren(obj: any) {
    let helperType = '';
    let helperItemsArray: any[] = [];
    obj[CO.type][CO.declaration][CO.children].forEach((item: any) => {
      helperType = this.determineType(item);
      helperItemsArray.push(item[CO.name] + ': ' + helperType);
    });
    return '{' + helperItemsArray.toString().replace(',', ', ') + '}';
  }

  parseTypeFromReflectionIndexSignature(obj: any) {
    const indexSignatureObject: any = {};
    const indexSignatureObjectHelper: any = {};
    obj[CO.type][CO.declaration][CO.indexSignature].forEach((item: any) => {
      item[CO.parameters].forEach((itemsItem: any) => {
        indexSignatureObjectHelper[itemsItem[CO.name]] = itemsItem[CO.type][CO.name];
        indexSignatureObject['[' + JSON.stringify(indexSignatureObjectHelper)
          .replace(/[{}]+/g, '') + ']'] = item[CO.type][CO.name];
      });
    });
    return JSON.stringify(indexSignatureObject)
      .replace(/[\\'"]+/g, '')
      .replace(/:/g, ': ');
  }

  parseTypeFromSignature(obj: any) {
    const mainReturnedType: any = this.determineType(obj[CO.type][CO.declaration][CO.signatures][0]);
    let parameters: any[] = [];
    obj[CO.type][CO.declaration][CO.signatures][0][CO.parameters].forEach((item: any) => {
      parameters.push(item[CO.name] + ': ' + this.determineType(item));
    });
    let returnedTypePrepared: string = '';
    parameters.forEach((item: any) => {
      returnedTypePrepared += item.toString() + ', ';
    });

    return ('(' + returnedTypePrepared + ') => ' + mainReturnedType).replace(/, \)/g, ')');
  }

  parseTypeParameter(obj: any) {
    return obj[CO.type][CO.name];
  }

  parseArray(obj: any) {
    return obj[CO.type][CO.elementType][CO.name] + '[]';
  }

  isStatic(obj: any): boolean {
    if (obj && obj[CO.flags] && obj[CO.flags][CO.isStatic]) {
      return obj[CO.flags][CO.isStatic];
    } else {
      return false;
    }
  }

  isMethod(obj: any) {
    return obj[CO.primKind] === 'Method';
  }

  isConstructor(obj: any) {
    return obj[CO.primKind] === 'Constructor';
  }

  isHasDescription(obj: any) {
    return obj && obj[CO.signatures] && obj[CO.signatures][0][CO.comment];
  }

  isIntrinsic(obj: any) {
    return obj[CO.type] === 'intrinsic';
  }

  isReference(obj: any) {
    return obj[CO.type] === 'reference';
  }

  isReflection(obj: any) {
    return obj[CO.type] === 'reflection';
  }

  isArray(obj: any) {
    return obj[CO.type] === 'array';
  }

  isTypeParameter(obj: any) {
    return obj[CO.type] === 'typeParameter';
  }
}

import { CO } from '../typedoc.parser.options';
import { InlineExample, OverviewNode } from '../../model';

export class OverviewParser {

  getOverview(obj: any): OverviewNode[] {
    const tags = obj[CO.comment][CO.tags];
    const content = tags && tags
      .map((example: any) => {
        if (example.tag.startsWith('inline-example')) {
          return this.parseInlineTag(example);
        }

        if (example.tag.startsWith('live-example')) {
          return this.parseLiveTag(example);
        }
      });

    return [
      this.getShortDescription(obj),
      this.getDescription(obj),
    ].concat(...content)
      .filter(tag => tag && tag.content);
  }

  private parseInlineTag(example: any): OverviewNode[] {
    const tagFinish = example.text.indexOf(')') + 1;
    const tag = example.tag.concat(example.text.substring(0, tagFinish));

    return [{
      type: 'inline-example',
      content: this.parseInlineExample(tag),
    }, {
      type: 'text',
      content: example.text.substring(tagFinish).trim(),
    }];
  }

  private parseLiveTag(example: any): OverviewNode[] {
    return [{
      type: 'live-example',
      content: this.parseLiveExample(example.tag),
    }, {
      type: 'text',
      content: example.text.trim(),
    }];
  }

  /**
   * Parses with the following pattern:
   * inline-example(example-path, lang, row-start, row-end)
   *
   * @example:
   * inline-example(some-component/some.component.ts, 21, 46)
   * inline-example(some-component/some.component)
   * */
  private parseInlineExample(raw: string): InlineExample {
    const example = raw.match(/\((.*)\)/);

    if (!example) {
      throw new Error(`Can't parse inline example: ${raw}`);
    }

    const [path, firstLine, lastLine] = example[1]
      .split(',')
      .map(x => x.trim());

    return {
      path,
      firstLine: +firstLine,
      lastLine: +lastLine,
    };
  }

  private parseLiveExample(raw: string) {
    const example = raw.match(/\((.*)\)/);
    return example ? example[1] : '';
  }

  private getDescription(obj: any): OverviewNode {
    return {
      type: 'text',
      content: obj && obj[CO.comment] && obj[CO.comment]['text'],
    };
  }

  private getShortDescription(obj: any): OverviewNode {
    return {
      type: 'text',
      content: obj && obj[CO.comment] && obj[CO.comment]['shortText'],
    };
  }
}

import {Param} from '../../model';
import {CO} from '../typedoc.parser.options';

export class ParamsParser {

  getParams(obj: any): Param[] {
    if (this.isHasParams(obj)) {
      return obj[CO.signatures][0][CO.parameters]
        .map((item: any) => this.parseParam(item));
    } else {
      return [];
    }
  }

  parseParam(param: any) {
    return new Param({
      name: param[CO.name],
      type: this.getType(param),
      required: null,
      shortDescription: this.getShortDescription(param),
      description: this.getDescription(param)
    });
  }

  getType(param: any): string {
    if(param && param[CO.type]) {
      let type = '';
      if (param[CO.type][CO.type] && param[CO.type][CO.type] === 'reference') {
        if (param[CO.comment] && param[CO.comment][CO.text]) {
          type = param[CO.comment][CO.text];
        } else {
          type = param[CO.type][CO.name]
        }
      } else if (param[CO.type][CO.type] && param[CO.type][CO.type] === 'intrinsic') {
        type = param[CO.type][CO.name]
      } else if (param[CO.type][CO.type] && param[CO.type][CO.type] === 'array') {
        type = param[CO.type][CO.elementType][CO.name] + '[]';
      }
      return type;
    } else {
      return '';
    }
  }

  getDescription(param: any): string {
    if (param && param[CO.comment]) {
      return param[CO.comment]['text'];
    } else {
      return '';
    }
  }

  getShortDescription(param: any): string {
    if (param && param[CO.comment]) {
      return param[CO.comment]['shortText'];
    } else {
      return '';
    }
  }

  isHasParams(obj: any) {
    return obj && obj[CO.signatures] && obj[CO.signatures][0][CO.parameters];
  }
}

import {Prop, PropKind} from '../../model';
import {CO} from '../typedoc.parser.options';
import {type} from "os";

export class PropertiesParser {

  getProps(obj: any): Prop[] {
    if (obj && obj[CO.children]) {
      return obj[CO.children]
        .filter((item: any) => this.isProperty(item) || this.isAccessor(item))
        .filter((item: any) => item[CO.comment])
        .map((item: any) => {
          if (item[CO.decorators]) {
            if (this.isInput(item)) {
              return this.parseProperty(item, 'input');
            } else if (this.isOutput(item)) {
              return this.parseProperty(item, 'output');
            } else {
              return this.parseProperty(item, 'property');
            }
          } else {
            return this.parseProperty(item, 'property');
          }

        });
    } else {
      return [];
    }
  }

  parseProperty(obj: any, kind: PropKind): Prop {
    return new Prop({
      kind: kind,
      platform: null,
      isStatic: this.isStatic(obj),
      type: this.getType(obj),
      required: null,
      name: this.getName(obj),
      description: this.getDescription(obj),
      shortDescription: this.getShortDescription(obj)
    });
  }

  getName(obj: any) {
    if (obj[CO.decorators]) {
      if (this.isInput(obj) && obj[CO.decorators][0][CO.arguments][CO.bindingPropertyName]) {
        return obj[CO.decorators][0][CO.arguments][CO.bindingPropertyName].replace(/'/g, '');
      } else {
        return obj[CO.name];
      }
    } else {
      return obj[CO.name];
    }
  }

  getType(prop: any): string {
    if (prop[CO.type] && prop[CO.type][CO.type]) {
      let type = '';
      if (prop[CO.type][CO.type] === 'intrinsic') {
        type = this.getTypeIntrinsicProp(prop);
      } else if (prop[CO.type][CO.type] === 'array') {
        type = this.getTypeArrayProp(prop);
      } else if (prop[CO.type][CO.type] === 'reference') {
        type = this.getTypeReferenceProp(prop);
      }
      return type;
    } else {
      return this.getTypeOther(prop);
    }
  }

  getTypeIntrinsicProp(prop: any) {
    return prop[CO.type][CO.name];
  }

  getTypeArrayProp(prop: any) {
    return prop[CO.type][CO.elementType][CO.name] + '[]';
  }

  getTypeReferenceProp(prop: any) {
    if (prop[CO.type][CO.typeArguments] && prop[CO.type][CO.typeArguments].length !== 0) {
      return prop[CO.type][CO.name] + '<' + prop[CO.type][CO.typeArguments][0][CO.name] + '>';
    } else {
      return prop[CO.type][CO.name];
    }
  }

  getTypeOther(prop: any) {
    if (prop[CO.comment][CO.tags] && prop[CO.comment][CO.tags].length !==0) {
      return prop[CO.comment][CO.tags][0][CO.text].replace(/[\n{}]+/g, '');
    } else if(prop[CO.setSignature] && prop[CO.setSignature].length !== 0 &&
      prop[CO.setSignature][0][CO.parameters] && prop[CO.setSignature][0][CO.parameters].length !== 0) {
      return prop[CO.setSignature][0][CO.parameters][0][CO.type][CO.name];
    } else if (prop[CO.getSignature] && prop[CO.getSignature].length !== 0) {
      return prop[CO.getSignature][0][CO.type][CO.name];
    }
  }

  getDescription(prop: any): string {
    if (prop && prop[CO.comment]) {
      return prop[CO.comment]['text'];
    } else {
      return '';
    }
  }

  getShortDescription(prop: any): string {
    if (prop && prop[CO.comment]) {
      return prop[CO.comment]['shortText'];
    } else {
      return '';
    }
  }

  isStatic(prop: any): boolean {
    if (prop && prop[CO.flags] && prop[CO.flags][CO.isStatic]) {
      return prop[CO.flags][CO.isStatic];
    } else {
      return false;
    }
  }

  isProperty(obj: any) {
    return obj[CO.primKind] === 'Property';
  }

  isAccessor(obj: any) {
    return obj[CO.primKind] === 'Accessor';
  }

  isInput(prop: any) {
    return prop[CO.decorators][0][CO.name] === 'Input';
  }

  isOutput(prop: any) {
    return prop[CO.decorators][0][CO.name] === 'Output';
  }
}

import { Style } from '../../model';
import { CO } from '../typedoc.parser.options';

export  class StylesParser {

  getStyles(obj: any): Style[] {
    if (this.isHasTags(obj)){
      return obj[CO.comment][CO.tags]
        .filter((item: any) => this.isStyle(item))
        .map((item: any) => this.parserStyle(item));
    } else {
      return [];
    }
  }

  parserStyle(obj: any): Style {
    return new Style({
      shortDescription: this.getShortDescription(obj),
      styles: this.getStylesOfStyle(obj)
    });
  }

  getStylesOfStyle(obj: any): any[] {
    if (obj && obj[CO.text]) {
      const arr = obj[CO.text].split('\n\n');
      let tempArr: any[] = [];
      const returnArr: any[] = [];
      arr.splice(0, 1);
      tempArr = arr[0].split('\n');
      tempArr.forEach((item: any) => {
        if (item) {
          const [key, value] = item.split(':');
          const styleObj: any = {};
          styleObj['name'] = key ? key.trim() : '';
          styleObj['description'] = value ? value.trim() : '';
          returnArr.push(styleObj);
        }
      });
      return returnArr;
    } else {
      return [];
    }
  }

  getShortDescription(style: any): string {
    if (style && style[CO.text]) {
      const workString = style[CO.text].replace(/\r\n\r\n/g, '/n/n').split(/\n\n/g);
      return workString[0];
    } else {
      return '';
    }
  }

  isHasTags(obj: any) {
    return obj && obj[CO.comment] && obj[CO.comment][CO.tags] &&
      obj[CO.comment][CO.tags].length;
  }

  isStyle(obj: any) {
    return obj[CO.tag] === 'styles';
  }
}
